$(function () {
    setTimeout(function() {
        $('#mydiv').fadeOut(5000);
    }, 2000);

    $("h6.wsite-content-title").click(function(){
        var id = $(this).attr("id");
        $("#comment_id").val(id);
    });
    $("h6.wsite-content-title").click(function() {
        $('html,body').animate({
                scrollTop: $("#comments_f").offset().top},
            1000);
    });
    $("#comments").click(function() {
        $('html,body').animate({
                scrollTop: $("#commentsss").offset().top},
            1000);
    });



});

